import React from "react";
import "../comp-layout/LayoutHeader.css";

export const LayoutHeader = () => {
  return (
    <header className="header">
      <div className="logo-empresa">
        <img src="../img/logo-empresa.png" alt="Descripción" />
      </div>
      <div className="user-data-container">
        <label>Nombre del usuario aquí</label>
        <div className='image-container'>
          <img src={formData.url_imagen_cliente || 'default-image-url.jpg'} alt={`Imagen de ${formData.nombre_cliente}`} className="image-cliente" />
        </div>
      </div>
    </header>
  );
};
